commit.message:
server: enable _patch_ verb for policy farms

In order to speed up the configuration of farm policies, in the case
of a big amount of policies configured in a given farm, instead of
deleting the policies and apply again the new configuration we
enable the PATCH verb in the API server.

With the PATCH /farms/<my_farm>/policies/ call, the service will
take care of stopping all the associated nft rules, delete the
objects and apply the new ones. The JSON structure it is required
to apply to the farm with the policies list.

{
        "farms": [
                {
                        "name": "newfarm",
                        "policies": [
                                {
                                        "name": "aa_white1"
                                },
                                {
                                        "name": "aa_white2"
                                }
                        ]
                }
        ]
}

Signed-off-by: nevola <laura.garcia@zevenet.com>

elements: fix parsing policy elements when no counter is present

Wrong parsing policy elements when no counter is present due to
old kernels:

{
        "policies": [
                {
                        "name": "testBL",
                        "family": "ipv4",
                        "type": "whitelist",
                        "route": "in",
                        "timeout": "0",
                        "log-prefix": "[WL,testBL,FNAME]",
                        "used": "1",
                        "elements": [
                                {
                                        "data": "192.168.15.0/24,",
                                        "counter-packets": "0",
                                        "counter-bytes": "0"
                                }
                        ]
                }
        ]
}

This patch adapts the elements parsing to be used with and
without counters. This could happen due to old kernel versions.

With kernel 4.19:

table netdev nftlb {
	set testBL {
		type ipv4_addr
		flags interval
		auto-merge
		elements = { 192.168.15.0/24 }
	}
}

With kernel 5.12:

table netdev nftlb {
	set testBL {
		type ipv4_addr
		flags interval
		counter
		auto-merge
		elements = { 192.168.15.0/24 counter packets 0 bytes 0 }
	}
}

Signed-off-by: nevola <laura.garcia@zevenet.com>

sessions: fix parsing sessions when timeout attribute is present

Some kernels could dump the timeout attribute like:

table ip nftlb {
	map persist-l4farm {
		type ipv4_addr : mark
		size 65535
		timeout 1h40m
		elements = { 192.168.10.154 timeout 1h40m expires 1h38m12s20ms : 0x80000200 }
	}
}

So make the parsing ignore the timeout attribute if exists.

Signed-off-by: nevola <laura.garcia@zevenet.com>
